import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
        <form >
            <input type="email" name="email" id=""/>
            <input type="password" name="password" id=""/>
            <input type="submit" name="Button" id=""/>
        </form>
    );
  }
}

export default App;
